import React, { useState } from 'react';
import "./NavBar.css";
import {useNavigate} from "react-router-dom";

const Navbar = ({view, setView,setShowModal}) => {
  const navigate=useNavigate();
  const onAdd=async()=>{
    setShowModal(true);
    navigate("/addJournal");
  }
  const onView=async()=>{
    navigate("/ViewJournal");
  }
  return (
    <nav className="custom-navbar">
      <div className="navbar-container">
        
        <div className="view-toggle">
        <button onClick={onAdd} className="button"> + Add </button>
        <button onClick={onView} className="button"> View </button>
        </div>

        {/* Right - View Options */}
        <div className="view-toggle">
          <button className={`view-button ${view === 'horizontal' ? 'active' : ''}`} onClick={() => setView('horizontal')}> Horizontal </button>
          <button className={`view-button ${view === 'vertical' ? 'active' : ''}`} onClick={() => setView('vertical')}> Vertical </button>
        </div>

      </div>
    </nav>
  );
};

export default Navbar;
